import React from 'react';
import logo from './logo.svg';
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Button from 'react-bootstrap/Button'
import Nav from 'react-bootstrap/Nav'
import './App.css';

const url = 'https://mdash.net';
const appId = 'M91ELwAFfFvq1j83qRiOAxA';

function bottomNav(props) {
  return (
    <Nav fill varient="pills" defaultActiveKey="/userPage" activeKey={props.page}>
      <Nav.Item>
        <Nav.Link href="/userPage">Home</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="/addDevice">Add Device</Nav.Link>
      </Nav.Item>
    </Nav>
  )
};

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      {bottomNav()}
    </div>

  );
}

export default App;
